import React from "react";
import ambulance from "../../assets/ambulance.svg";

const Header = () => {
  return (
    <div className="header">
      <div>
        <img src={ambulance} alt="" />
      </div>
      <div className="header__logo">Ambulance App</div>
    </div>
  );
};

export default Header;
